import React from "react";
import "./App.css";
import { Route, Routes, BrowserRouter } from "react-router-dom";
import Navbar from "./Components/Header/Navbar";
import ItemListContainer from "./Components/ItemListContainer/ItemListContainer";
import ItemDetailContainer from "./Components/ItemDetailContainer/ItemDetailContainer";
import Inicio from "./Components/Paginas/Inicio";
import Productos from "./Components/Paginas/Productos";
import Accesorios from "./Components/Paginas/Accesorios";
import Indumentaria from "./Components/Paginas/Indumentaria";
import Contacto from "./Components/Paginas/Contacto";
import CartWidget from "./Components/Header/CartWidget";
import Error404 from "../src/Eror404";




function App() {
  return (
    <>
      <BrowserRouter>
        <Navbar />

        <Routes>
          <Route index element={<ItemListContainer />} />
          <Route path={"/category/:id"} element={<ItemListContainer />} />
          <Route path={"/item/:id"} element={<ItemDetailContainer />} />
          <Route path="/inicio" element={<Inicio />} />
          <Route path="/productos" element={<Productos />} />
          <Route path="/category/accesorios" element={<Accesorios />} />
          <Route path="/category/indumentaria" element={<Indumentaria />} />
          <Route path="/contacto" element={<Contacto />} />
          <Route path="/category/cartwhidget" element={<CartWidget />} />
          <Route path={"*"} element={<Error404 />} />

        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
